    false,nt"url": null,nt"notes": "The data included in the GIS Traffic Stations
    Version database have been assimilated from station description files provided by
    FHWA for Weigh-in-Motion (WIM), and Automatic Traffic Counters (ATR). Location referencing
    information was derived from the National Highway Planning Network version 4.0.
    and State offices of Transportation The attributes on the point elements of the
    database have come from two primary sources, the Station Description Records and
    the National Highway Planning Network's Linear Referencing System. The attributes
    for these databases have been intentionally limited to location referencing attributes
    since the core station description attribute data are contained within the Station
    Description Tables (SDT). There is a separate Station Description Table (SDT) for
    each of the different station types; WIM, and ATR. The attributes in the Station
    Description Table correspond with the Station Description Record found in Chapter
    6 of the latest Traffic Monitoring Guide. The SDT contains the most recent stations
    available for each state and station type. This table was derived from files provided
    UTCTR by FHWA. The Station Description Table can be linked to the station shapefile
    via the STNNKEY field . A single exception table containing records for those stations
    that could not be located is provided for WIM, and ATR stations. Generally, this
    table contains records where location descriptions were not clear enough to locate
    a station. It is hoped that FHWA will be able to contact the States for a more detailed
